Columbus - The Lost Voyage

History Documentary hosted by Ed Herrmann, published by History Channel in 2007 - English narration


Information
------------------------------

The true story of Christopher Columbus was not only one of victorious discovery; it was also marked by disaster, accusation, and betrayal. Ten short years after his discovery of the New World, Columbus languished in a Caribbean prison. There, awaiting the gallows, he plotted what he called his most treacherous voyage--one that ended with the loss of all four of his ships and left Columbus and his crew shipwrecked with little hope of survival.

Now, THE HISTORY CHANNEL brings to life the perilous catastrophes and dizzying triumphs of Columbus last voyage. Popular historian, explorer, and acclaimed author of The Last Voyage of Columbus, Martin Dugard, travels in the wake of the great explorer, visiting the key sites of Columbus discoveries and disasters, such as Panama, Jamaica, and Hispaniola, reliving one of history s most epic--and forgotten--adventures. Interviews with local experts and dramatic recreations reveal the truth about the last, untold journey, and paint an intimate portrait of this complex and courageous hero.

Executive Producer : Bill Locke
Director : Anna Thomson
Narrator : Ed Herrmann

A Lion Television Production for The History Channel (2007)

